(253227, 'ruRU', 'В коллапсирующей альтернативной временной линии, где драконы Бесконечности экспериментируют с историей третьего вторжения Легиона, неоскверненные фрагменты времени встречаются крайне редко – и обладают феноменальной мощью.', '', '', '', 'Безупречная нить времени', 65299),
